import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


const AdminNavbar2 = () => {
    return (
        <div>
            <FontAwesomeIcon icon="coffee" />
        </div>
    );
}

export default AdminNavbar2;
